import React from "react";

const Header = (props) => {
    const { name, hasName, children } = props;
    // const {name} = props;
    return (
        <div>

        <h1
        className = "header--name"
        style={{
            backgroundColor: "gray",
        }}
        >
            Hello {name}
            </h1>
            <h2>Menus</h2>
            <div>{children}</div>
            </div> 
    );
};


const App = () => {
    const hasHeader = false;
    const name = "jeon jinho";

    return (
        <div>
            {hasHeader ? <Header name={name} hasName={false} >asd</Header> : null}
            <main>this is me</main>
        </div>
    );
};

//export { App };
export default App;
